// RUN: %clang_cc1 -triple x86_64-unknown-unknown -ast-dump=json %s | FileCheck %s

float func_16(float x, float y) {
  #pragma STDC FENV_ROUND FE_TOWARDZERO
  if (x < 0) {
    #pragma STDC FENV_ROUND FE_UPWARD
    return x - y;
  }
  return x + y;
}

